import React from "react";
import logo from "./logo.svg";
import "./App.css";
import {Raiting } from "./components/Rating/Rating";
import {Accordion} from "./components/Accordion/Accordion"
import {Button} from "./components/OnOff/OnOff"

const App = () => {

  const responseFromServer = Math.floor(Math.random()*10) > 4 ? true : false;
  return (
    <div>
      <Accordion title={"This is Accordion"} collapsed={responseFromServer} />
      <Accordion title={"The second title Accordion"} collapsed={false} />

      <Raiting value={0}/>
      <Raiting value={1}/>
      <Raiting value={2}/>
      <Raiting value={3}/>
      <Raiting value={4}/>
      <Raiting value={5}/>

      <Button button={true}/>
      <Button button={false}/>
    </div>
  ); 
};
export default App;
